sys_variable_value.value:
(function execute(inputs, outputs) {
 /**
     * Calculates sales commission based on total sales and commission rate.
     * Formula: commission = (salesAmount * commissionRate) / 100
     */

    // Get and parse inputs
    var salesAmount = parseFloat(inputs.salesAmount);
    var commissionRate = parseFloat(inputs.commissionRate);
    var baseSalary = parseFloat(inputs.baseSalary || 0); // optional

    // Validate inputs
    if (isNaN(salesAmount) || isNaN(commissionRate)) {
        outputs.error = "Invalid input values. Please check sales amount and commission rate.";
        return;
    }

    // Calculate commission and total pay
    var commission = (salesAmount * commissionRate) / 100;
    var totalPay = baseSalary + commission;

    // Set outputs
    outputs.sales_amount = salesAmount.toFixed(2);
    outputs.commission_rate = commissionRate.toFixed(2);
    outputs.commission = commission.toFixed(2);
    outputs.total_pay = totalPay.toFixed(2);
})(inputs, outputs);

